import { memo } from 'react'
import './MoreInformationTour.scss'

function MoreInformationTour() {
    return (
        <div className='d-flex form-general-tour plr-20'>
            <div className='w-50'>left</div>
            <div className='w-50'>right</div>
        </div>
    )
}

export default memo(MoreInformationTour)
